def firstUniqChar(s):	
	first_uniq_char_nums = list()
	for alphabet in set(s):
		if s.count(alphabet) == 1:
			first_uniq_char_nums.append(s.find(alphabet))
	if len(first_uniq_char_nums)>0:
		return min(first_uniq_char_nums)
	return -1

